import { ITodo } from "../atoms";

const Todo = ({ text, category }: ITodo) => {
  return (
    <li>
      <span>{text}</span>
      {category !== "DOING" && <button>Doing</button>}
      {category !== "TO_DO" && <button>ToDo</button>}
      {category !== "DONE" && <button>Done</button>}
    </li>
  );
};

export default Todo;
